import React, { Component } from 'react'
import Input from '../../general/Input';
 class Addproduct extends Component {
  render() {
    return (
      <div>
        <input
        type={type}
        placeholder={placeholder}
        name={name}
        value={value}
        onChange={onChange}
        style={style}
      />
      </div>
    )
  }
}
export default Addproduct;
